import React from 'react';

class EscalaList extends React.Component{

	renderAllTableRows(){
		return this.props.escala.map((item, i) => {
			return(
				<tr key={i}>
				    <td>{item.user}</td>
				    <td>{item.email}</td>
				    <td>{item.company}</td>
				    <td>{item.escalas}</td>
				    <td>{item.status}</td>
				</tr>
			)
		})
	}
	showResults(){
		if(!this.props.search.localeCompare("")){
			this.renderAllTableRows();
		}
	}

	render(){
		return(
			<div>
			<table>
	  			<thead>
		  			<tr>
		  				<th>Usu√°rio</th>
		  				<th>Email</th>
		  				<th>Company</th>
		  				<th>Escalas</th>
		  				<th>Status</th>
		  			</tr>
	  			</thead>
	  			<tbody>{this.showResults()}</tbody>
  			</table>
			</div>
		)
	}

}

export default EscalaList;
